import React, { StrictMode } from "react";
import { createRoot } from "react-dom/client";
import "./styles.css";

import App from "./App";
import Header from "./Header";

const main = createRoot(document.getElementById("main"));
main.render(
  <StrictMode>
    <Header />
    <App />
  </StrictMode>
);
